import React from "react";
import { NavLink } from "react-router-dom";
import "./Weather.css";

const Weather = (props) => {
    const { kecamatan, kota, propinsi, id, lat, lon } = props;
    const weatherElements = document.querySelectorAll('.weather');
    weatherElements.forEach((weatherElement, index) => {
        if (index > 15) {
            weatherElement.style.display = 'none';
        }
    });
    return (
        <div className="weather">
            <div className="card">
                <NavLink to={`/detail/${id}`}>
                    <h4 className="provinsi">{propinsi}</h4>
                    <img className="img" src="https://www.bmkg.go.id/asset/img/weather_icon/ID/cerah%20berawan-am.png" width="70" height="70" />
                    {/* <p className="id">{id}</p> */}
                    <p className="kota">{kota}</p>
                    <p className="kecamatan">{kecamatan}</p>
                    {/* <p className="lat">{lat}</p>
                <p className="lon">{lon}</p> */}
                </NavLink>
            </div>
        </div>
    );
};

export default Weather;
